#include <bits/stdc++.h>using namespace std;const int N = 100005;vector<int> adj[N];int vis[N];bool hasCycle = false;void dfs(int u) {    vis[u] = 1;    for (int v : adj[u]) {        if (vis[v] == 1) {            hasCycle = true;            return;        }        else if (vis[v] == 0) {            dfs(v);            if (hasCycle) return;        }    }    vis[u] = 2;}int main() {    int n, m;    if (cin >> n >> m) {        for (int i = 0; i < m; i++) {            int a, b;            cin >> a >> b;            adj[a].push_back(b);        }        for (int i = 1; i <= n; i++) {            if (vis[i] == 0) {                dfs(i);                if (hasCycle) break;            }        }        if (hasCycle) cout << "YES\n";        else cout << "NO\n";    }}